import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Caitlin Hulsey
          <br/>
          code / comedy / arts
          <br/>
          Contact:
        </p>
        <a
          className="App-link"
          href="mailto:caithuls8@gmail.com"
          target="_blank"
          rel="noopener noreferrer"
        >
          caithuls8@gmail.com
        </a>
      </header>
    </div>
  );
}

export default App;
